import java.util.HashSet;import java.util.Scanner;/** * @param * @author Administrator * @date 2021/3/31 0031 18:30 * @throws Exception */public class exam1 {    public static <Set> void main(String[] args) {        Scanner sc = new Scanner(System.in);        int n = sc.nextInt();        int count = 0;        int id = 0;        int M = 0;        HashSet<Integer> set = new HashSet<Integer>();        for (int i = 0; i < n; i++) {            int m = sc.nextInt();            for (int j = 0; j < m; j++) {                id = sc.nextInt();                if (m != 1) {                    set.add(id);                }            }        }        int num = sc.nextInt();        for (int i = 0; i < num; i++) {            int newId = sc.nextInt();            if (set.add(newId)) {                if (count == 0) {                    System.out.printf("%05d", newId);                } else {                    System.out.printf("%05d", newId);                }                count++;            }        }    }}